var MidiWriter = require('./');
//console.log(MidiWriter)
var track = new MidiWriter.Track();
track.addEvent(new MidiWriter.ProgramChangeEvent({instrument : 3}));
track.addInstrumentName("Garrett");
track.addInstrumentName("Garrett Track");
track.addEvent(new MidiWriter.NoteEvent({
pitch : ['C4','B#4'],
duration : '4'
}));



var write = new MidiWriter.Writer([track]);
//console.log(MidiWriter.Constants)
//console.log(write.buildFile());
write.stdout();